  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Guam NWR for the next 15 years. This plan outlines
  the Refuge vision and purpose and describes how Guam NWR will contribute to the
  overall mission of the Refuge System. The plan provides an introduction to the Refuge;
  an overview of the CCP process; and information about the physical environment,
  the management direction, Refuge biology, habitat, and Refuge facilities. Key planning
  issues include: wildlife management, habitat management, public use, cultural resources,
  climate change, coral reefs, and interagency coordination.\",\n\t\"license_title\":
